def _get_grouper(
    obj,
    key=None,
    axis=0,
    level=None,
    sort=True,
    observed=False,
    mutated=False,
    validate=True,
):
    group_axis = obj._get_axis(axis)

    if level is not None and isinstance(group_axis, MultiIndex):
        if is_list_like(level) and len(level) == 1:
            level = level[0]

        if key is None and is_scalar(level):
            key = group_axis.get_level_values(level)
            level = None

    else:
        if is_list_like(level):
            nlevels = len(level)
            if nlevels == 1:
                level = level[0]
            elif nlevels == 0:
                raise ValueError("No group keys passed!")
            else:
                raise ValueError("multiple levels only valid with MultiIndex")

        if isinstance(level, str):
            if obj.columns.name != level:
                raise ValueError(
                    "level name {} is not the name of the index".format(level)
                )
        elif level > 0 or level < -1:
            raise ValueError("level > 0 or level < -1 only valid with MultiIndex")

        level = None
        key = group_axis

    # handle grouping along columns by column names
    if isinstance(key, str):
        if key not in obj.columns:
            raise KeyError(key)
        key = obj[key]

    if validate and is_timedelta64_dtype(group_axis) and len(group_axis) != obj.shape[axis]:
        raise ValueError("Length of grouper and axis must be the same length")

    ping = Grouping(
        group_axis,
        key,
        obj=obj,
        name=None,
        level=level,
        sort=sort,
        observed=observed,
        in_axis=True,
    )

    grouper = BaseGrouper(group_axis, [ping], sort=sort, mutated=mutated)
    return grouper, [], obj
